import './App.css';
import React  from "react";
import './App.css'
import 'antd/dist/antd.css'
import './index.css'
import InputBox from './component/Input'
import {Button, PageHeader} from "antd";
import PicturesWall from "./component/UploadBox";
import TextArea from "antd/es/input/TextArea";
import OutputBox from "./component/output";
import Copy from "./component/copy";
import {CopyToClipboard} from "react-copy-to-clipboard/lib/Component";
import ButtomControlLine from "./component/ButtonControlLine";



function App() {
  return (
    <div className="App">
      <div>
          <div className="App-header">
              <PageHeader>Content Analyzer</PageHeader>
          </div>

          <div className="Control-line">
              <div>
                  <Button>
                      Key Sentence
                  </Button>
                  <Button>
                      Key Words
                  </Button>
                  <Button>
                      Summary
                  </Button>
                  <Copy/>
              </div>
          </div>

          <div className="ContentBox">
              <InputBox/>
              <OutputBox/>
          </div>
          <div className="Analyze-Button-Line">
              <ButtomControlLine/>

          </div>

      </div>


    </div>
  );
}

export default App;
